function funTerrain() {
  var time = new Date().getTime() / 1000.0 - game.startTime;
  for (var i = 0; i < game.scene.ground.geometry.attributes.position.length; i += 3) {
    var x = game.scene.ground.geometry.attributes.position.array[i];
    var z = game.scene.ground.geometry.attributes.position.array[i + 2];
    var noise = game.noiseGen.noise3d(x / 100, z / 100, time);
    var normalNoise = (noise + 1) / 2;
    var y = normalNoise * config.terrain.maxElevation;
    game.scene.ground.geometry.attributes.position.array[i + 1] = y;

    var xi = (x + config.terrain.width / 2) * config.terrain.xFaces / config.terrain.width;
    var yi = (z + config.terrain.height / 2) * config.terrain.yFaces / config.terrain.height;
    game.heightField[xi][yi] = y;
  }
  game.scene.ground.geometry.computeFaceNormals();
  game.scene.ground.geometry.computeVertexNormals();
  game.scene.ground.geometry.attributes.position.needsUpdate = true;
}

function getCameraFocus(mouseX, mouseY) {
  // TODO: optimize to not use raycasting
  // TODO: move/use this function in MapControls
  var camera = game.scene.camera;
  var vector = new THREE.Vector3(mouseX, mouseY, camera.near);
  var mesh = game.scene.navigationPlane;
  vector.unproject(camera);
  var raycaster = new THREE.Raycaster(camera.position, vector.sub(camera.position).normalize());
  var intersects = raycaster.intersectObject(mesh);
  if (intersects.length > 0) {
    return intersects[0].point;
  } else {
    // TODO: handle it better
    // console.log("ray", mouseX, mouseY, intersects, camera.position);
    // console.warn("nav fail");
    return new THREE.Vector3(0, 0, 0);
  }
}

