function checkCollisions() {
  var boxes = getBBoxes();

  // intersect boxes
  boxIntersect(boxes, function (i, j) {
    var p1 = boxes[i].unit.position;
    var p2 = boxes[j].unit.position;
    var d = p2.clone();
    // clearLog();
    // log(i, j, p1, p2, d);
    d.sub(p1);
    d.y = 0;
    // randomize if they have same position
    if (d.equals(new THREE.Vector3(0, 0, 0))) {
      d.x = Math.random();
      d.z = Math.random();
    }
    d.normalize();
    d.multiplyScalar(config.units.collisionBounce);
    var p1new = p1.clone().sub(d);
    var p2new = p2.clone().add(d);
    if (p1new.x >= game.mapBounds.min.x && p1new.x <= game.mapBounds.max.x && p1new.z >= game.mapBounds.min.z && p1new.z <= game.mapBounds.max.z) {
      p1.sub(d);
    }
    if (p2new.x >= game.mapBounds.min.x && p2new.x <= game.mapBounds.max.x && p2new.z >= game.mapBounds.min.z && p2new.z <= game.mapBounds.max.z) {
      p2.add(d);
    }
  });
}

