function Explosions() {
  var texture = THREE.ImageUtils.loadTexture('models/images/explosion.png');
  texture.anisotropy = game.scene.renderer.getMaxAnisotropy();
  texture.minFilter = THREE.NearestFilter;
  texture.wrapS = texture.wrapT = THREE.ClampToEdgeWrapping;

  var material = new THREE.ShaderMaterial({
    uniforms: {
      tExplosion: {
        type: 't',
        value: texture
      },
      time: {
        type: 'f',
        value: 0.0
      },
      opacity: {
        type: 'f',
        value: 0.0
      }
    },
    vertexShader: $('#explosion-vertex').text(),
    fragmentShader: $('#explosion-fragment').text(),
    transparent: true
  });
  var geometry = new THREE.IcosahedronGeometry(20, 4);
  geometry.computeFaceNormals();
  geometry.computeVertexNormals();

  this.pool = [];

  this.createExplosion = function () {
    var mesh = undefined;
    if (this.pool.length > 0) {
      mesh = this.pool.pop();
    } else {
      var newMaterial = material.clone();
      newMaterial.uniforms.tExplosion.value = texture;
      mesh = new THREE.Mesh(geometry, newMaterial);
      mesh.renderOrder = game.renderOrders.explosion;
    }
    return mesh;
  };

  this.returnExplosion = function (explosion) {
    this.pool.push(explosion);
  };

  var newpool = [];
  for (var i = 0; i < config.effects.explosionPool; i++) {
    var mesh = this.createExplosion();
    newpool.push(mesh);
  }
  this.pool = newpool;
}

function getApplyShot(unit, target, shotMesh) {
  return function () {
    var _this = this;

    var oldHealth = target.health;
    target.health -= unit.weapon.damage;
    game.missiles.returnMissile(shotMesh);
    //removeFromScene(shotMesh);
    shotMesh = null;
    if (target.health <= 0 && oldHealth > 0) {
      (function () {
        target.dead = true;
        var pos = target.position.clone();
        target = null;
        var explosion = game.explosions.createExplosion();
        explosion.position.copy(pos);
        explosion.time = 0;
        explosion.tscale = 0;
        explosion.opacity = 2;
        explosion.material.uniforms.time.value = _this.time;
        //explosion.material.uniforms.tExplosion.value = game.explosion;
        addToScene(explosion);
        var seed = Math.random();
        game.sound.blast();
        var tween = new TWEEN.Tween(explosion).to({ time: 1, tscale: 1, opacity: 0 }, 1000).onUpdate(function () {
          this.material.uniforms.time.value = this.time + seed;
          this.material.uniforms.opacity.value = this.opacity;
          var scale = this.tscale;
          this.scale.set(scale, scale, scale);
        }).onComplete(function () {
          game.explosions.returnExplosion(explosion);
          //removeFromScene(explosion);
          explosion = null;
        }).start();
      })();
    }
  };
}

