function initM3Models() {
  var modelLoader = new ModelLoader({
    camera: game.scene.camera,
    scene: game.scene.scene3,
    light: game.scene.light,
    getCameraFocus: getCameraFocus,
    maxInstancesPerModel: config.units.m3count * 2
  });
  var $modal = $('#m3progress');
  var $modalBody = $modal.find('.modal-body');
  var sources = {};
  $modal.modal();

  var progress = function progress(evt) {
    // function handles progress events of two types:
    // from Viewer.addEventListener('load') and from THREE.CompressedTextureLoader
    var source = evt.target.source || evt.target.responseURL;
    if (sources[source] === undefined) {
      var _$progress = $('#m3unit.progress').clone();
      _$progress.attr('id', '');
      _$progress.removeClass('invisible');
      $modalBody.append(_$progress);
      sources[source] = {
        $progress: _$progress
      };
    }
    var $progressParent = sources[source].$progress;
    var $progress = sources[source].$progress.find('.progress-bar');
    var $progressText = $progress;
    function setProgress(value, text) {
      var val = Math.round(value * 100);
      if (val === 100) {
        $progressParent.remove();
      } else {
        $progress.attr('aria-valuenow', val);
        $progress.css({
          width: val + '%'
        });
        $progressText.html(val + '% ' + text);
      }
    }
    var filename = source.replace(/^.*[\\\/]/, '');
    setProgress(evt.loaded / evt.total, filename);
  };

  var modelPromise = modelLoader.loadModels(progress);
  modelPromise.then(function () {
    game.m3loader = modelLoader;
    $modalBody.append('<p>All M3 models loaded!</p>');
    if ($('#units.progress .progress-bar').attr('aria-valuenow') === '100') {
      $modal.modal('hide');
    }
    createM3Units();
  });
}

